  false,\n\t\"url\": null,\n\t\"notes\": \"This project is a cooperative effort among
  the National Ocean Service, National Centers for Coastal Ocean Science, Center for
  Coastal Monitoring and Assessment; the United States Geological Survey; the National
  Park Service; and the National Geophysical Data Center, to produce benthic habitat
  maps and georeferenced imagery for Puerto Rico and the U.S. Virgin Islands. This
  project was conducted in support of the U.S. Coral Reef Task Force. Twenty-one distinct
  benthic habitat types within eight zones were mapped directly into a GIS system
  using visual interpretation of orthorectified aerial photographs. Benthic features
  were mapped that covered an area of 1600 km^2. In all, 49 km^2 of unconsolidated
  sediment, 721 km^2 of submerged vegetation, 73 km^2 of mangroves, and 756 km^2 of
  coral reef and colonized hardbottom were mapped.\",\n\t\"license_title\": null,\n\t\"extras\":
